The MudExThemeEdit is a robust and versatile tool designed to effectively facilitate the editing of one or more themes or presets. It inherently accommodates Dark mode, Light mode, or a combination of both. Additionally, it supports derived classes from MudTheme, as well as custom properties inherent to it, thus providing a comprehensive and flexible solution for all your theme editing requirements.: MudExThemeEdit je robustní a všestranný nástroj navržený tak, aby efektivně usnadnil úpravy jednoho nebo více témat nebo předvoleb. Ze své podstaty se přizpůsobuje tmavému režimu, světlému režimu nebo kombinaci obou. Navíc podporuje odvozené třídy z MudTheme, stejně jako vlastní vlastnosti, které jsou s ním spojeny, a poskytuje tak komplexní a flexibilní řešení pro všechny vaše požadavky na úpravu motivů.
